import styles from './showInfor.module.scss';
import classNames from 'classnames/bind';
import { useState, useEffect } from "react";
import { fetchData } from '../../../../services/api'; // Import API service
const cx= classNames.bind(styles)

function ShowInfor({ data}) {
    if (!data) return null;

  

    return (
        <div className={cx("modal")}>
            <div className={cx('contents')}>
            {data.map((preview, index) => (
                                            <div key={index} className={cx('image-preview-wrapper')} >
                                                
                                                
                                            </div>
                                        ))}
            </div>
        </div>
    );
}
export default ShowInfor;
